import React from 'react'
import { Link } from 'react-router-dom';

const Report = (props) => {
    return ( 
        <div className="w3-container w3-margin-top">
        <div className="w3-round-xlarge w3-light-gray">
        <div className="w3-container">
        <p><u><b>Creative Genius</b></u></p>
        <div className="w3-container w3-cell-row">
        <div class="w3-cell">
        <i class="fas fa-award"></i>
        </div>
        <div className="w3-cell w3-round-xxlarge w3-center" style={{backgroundColor: 'lightgray'}}>
       <Link to='/report'><p className="w3-padding-16" >View Report</p></Link>
       </div>
        </div>
        </div>
        </div>
        </div> 
    );
}

export default Report;
